oxy_webhelp_navlinks = {"microsoft_entra_id-d22872e23681":{"topics":[{"title":"Known limitations for Microsoft Entra ID on <span class=\"ph\">RSC<\/span>","shortdesc":"<p class=\"shortdesc\">Microsoft Entra ID on <span class=\"ph\">RSC<\/span> includes some known limitations for         recovering groups, users, relationships, and Microsoft Entra ID properties.<\/p>","href":"saas\/ms_entra_id_known_limits_rsc.html","attributes":{"data-id":"ms_entra_id_known_limits_rsc"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_known_limits_rsc-d22872e23694","topics":[]},{"title":"Non-recovery of soft-deleted objects by <span class=\"ph\">RSC<\/span>","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> does not recover higher-privileged, soft-deleted Microsoft Entra         ID user or group objects. Instead, <span class=\"ph\">RSC<\/span> creates new objects, leaving the         soft-deleted ones in the Microsoft Recycle Bin.<\/p>","href":"saas\/ms_entra_id_non_recov_soft_del_obj_rsc.html","attributes":{"data-id":"ms_entra_id_non_recov_soft_del_obj_rsc"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_non_recov_soft_del_obj_rsc-d22872e23710","topics":[]},{"title":"Adding Microsoft Entra ID with OAuth","shortdesc":"<p class=\"shortdesc\">Add Microsoft Entra ID as a protected workload that uses OAuth for         authentication.<\/p>","href":"saas\/adding_entra_id_with_oauth.html","attributes":{"data-id":"adding_entra_id_with_oauth"},"menu":{"hasChildren":false},"tocID":"adding_entra_id_with_oauth-d22872e23728","topics":[]},{"title":"Adding Microsoft Entra ID without OAuth","shortdesc":"<p class=\"shortdesc\">Add a Microsoft Entra ID directory as a protected workload without OAuth, and instead         use your existing Microsoft Entra ID application registration.<\/p>","href":"saas\/adding_entra_id_without_oauth.html","attributes":{"data-id":"adding_entra_id_without_oauth"},"menu":{"hasChildren":false},"tocID":"adding_entra_id_without_oauth-d22872e23739","next":"adding_entra_id_without_oauth-d22872e23739"},{"title":"Protecting Microsoft Entra ID","shortdesc":"<p class=\"shortdesc\">Choose a data protection policy for a Microsoft Entra ID directory.<\/p>","href":"saas\/ms_entra_id_protecting.html","attributes":{"data-id":"ms_entra_id_protecting"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_protecting-d22872e23763","topics":[]},{"title":"Taking on-demand snapshots of Microsoft Entra ID","shortdesc":"<p class=\"shortdesc\">Take on-demand snapshots of Microsoft Entra ID protectable objects in addition to the         policy-based snapshots provided by the SLA Domain.<\/p>","href":"saas\/ms_entra_id_taking_ods.html","attributes":{"data-id":"ms_entra_id_taking_ods"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_taking_ods-d22872e23774","topics":[]},{"title":"Deleting a Microsoft Entra ID snapshot","shortdesc":"<p class=\"shortdesc\">Delete a Microsoft Entra ID snapshot that has the Forever retention policy         assigned.<\/p>","href":"saas\/ms_entra_id_deleting_snapshot.html","attributes":{"data-id":"ms_entra_id_deleting_snapshot"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_deleting_snapshot-d22872e23785","topics":[]},{"title":"Viewing Microsoft Entra ID directories","shortdesc":"<p class=\"shortdesc\">View details for the Microsoft Entra ID directories.<\/p>","href":"saas\/ms_entra_id_viewing_directories.html","attributes":{"data-id":"ms_entra_id_viewing_directories"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_viewing_directories-d22872e23796","next":"ms_entra_id_viewing_directories-d22872e23796"},{"title":"Microsoft Entra ID object and relationship recovery","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> recovers various Microsoft Entra ID objects and object         relationships, including users, groups, roles, enterprise apps, and app         registrations.<\/p>","href":"saas\/ms_entra_id_obj_relationship_recovery.html","attributes":{"data-id":"ms_entra_id_obj_relationship_recovery"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_obj_relationship_recovery-d22872e23818","next":"ms_entra_id_obj_relationship_recovery-d22872e23818"},{"title":"Microsoft Entra ID user object attribute recovery","shortdesc":"<p class=\"shortdesc\">Attribute recovery for a Microsoft Entra ID user object selectively restores specific         attributes that were maliciously or accidentally altered without performing a full object         restore. You can compare user object attributes from a snapshot against live data and         recover only the changed attributes.<\/p>","href":"saas\/ms_entra_id_user_obj_attr_recov.html","attributes":{"data-id":"ms_entra_id_user_obj_attr_recov"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_user_obj_attr_recov-d22872e23935","next":"ms_entra_id_user_obj_attr_recov-d22872e23935"},{"title":"Microsoft Entra ID object recovery across snapshots","shortdesc":"<p class=\"shortdesc\">With <span class=\"ph\">RSC<\/span>, you can search Microsoft Entra ID user, groups, and roles         objects for recovery across different snapshots. This functionality enables recovery of         objects and relationships from a specific date and time.<\/p>","href":"saas\/ms_entra_id_obj_recov_across_snapshots.html","attributes":{"data-id":"ms_entra_id_obj_recov_across_snapshots"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_obj_recov_across_snapshots-d22872e23969","next":"ms_entra_id_obj_recov_across_snapshots-d22872e23969"},{"title":"Microsoft Entra ID Conditional Access recovery","shortdesc":"<p class=\"shortdesc\">For Microsoft Entra ID directories that support Conditional Access, <span class=\"ph\">RSC<\/span> can protect Microsoft Entra ID Conditional Access objects and relationships.<\/p>","href":"saas\/ms_entra_id_conditional_access_recovery.html","attributes":{"data-id":"ms_entra_id_conditional_access_recovery"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_conditional_access_recovery-d22872e24016","next":"ms_entra_id_conditional_access_recovery-d22872e24016"},{"title":"Recovery in a hybrid identity environment","shortdesc":"<p class=\"shortdesc\">In a hybrid Microsoft Entra ID and Active Directory environment on <span class=\"ph\">RSC<\/span>, you can view Active Directory group and user assignments synced from the Active         Directory domain. You can additionally recover relationships for synced Active Directory         user and group objects and protect the Active Direct domain.<\/p>","href":"saas\/ms_entra_id_recovery_hybrid_env.html","attributes":{"data-id":"ms_entra_id_recovery_hybrid_env"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_recovery_hybrid_env-d22872e24058","next":"ms_entra_id_recovery_hybrid_env-d22872e24058"},{"title":"Microsoft Entra ID full domain recovery","shortdesc":"<p class=\"shortdesc\">Using Microsoft Entra ID full domain recovery, administrators can restore all objects         and relationships in a domain from a previous state. You can specify objects to exclude from         recovery.<\/p>","href":"saas\/ms_entra_id_full_domain_recov.html","attributes":{"data-id":"ms_entra_id_full_domain_recovery"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_full_domain_recovery-d22872e24111","next":"ms_entra_id_full_domain_recovery-d22872e24111"},{"title":"Downloading Microsoft Entra ID recovery details","shortdesc":"<p class=\"shortdesc\">Download a CSV file containing information about a completed Microsoft Entra ID         snapshot recovery. The information includes details about object IDs, object display names,         object types, and relationship recovery.<\/p>","href":"saas\/ms_entra_id_downloading_recovery_details.html","attributes":{"data-id":"ms_entra_id_downloading_recovery_details"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_downloading_recovery_details-d22872e24133","next":"ms_entra_id_downloading_recovery_details-d22872e24133"},{"title":"Editing Microsoft Entra ID directories with OAuth","shortdesc":"<p class=\"shortdesc\">Edit the login accounts that access Microsoft Entra ID as a protected workload that         uses OAuth.<\/p>","href":"saas\/ms_entra_id_editing_directories_oauth.html","attributes":{"data-id":"editing_ms_entra_id_directories_oauth"},"menu":{"hasChildren":false},"tocID":"editing_ms_entra_id_directories_oauth-d22872e24155","topics":[]},{"title":"Editing Microsoft Entra ID directories without OAuth","shortdesc":"<p class=\"shortdesc\">Edit login accounts that access Microsoft Entra ID as a protected workload that does         not use OAuth.<\/p>","href":"saas\/ms_entra_id_editing_directories_without_oauth.html","attributes":{"data-id":"ms_entra_id_editing_directories_without_oauth"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_editing_directories_without_oauth-d22872e24166","topics":[]},{"title":"Deleting Microsoft Entra ID domains from directories","shortdesc":"<p class=\"shortdesc\">Delete a Microsoft Entra ID domain from a directory when the domain no longer         requires protection.<\/p>","href":"saas\/ms_entra_id_deleting_domains_directories.html","attributes":{"data-id":"ms_entra_id_deleting_domains_directories"},"menu":{"hasChildren":false},"tocID":"ms_entra_id_deleting_domains_directories-d22872e24177","topics":[]}]}};